import React from 'react';
import ReactDOM from 'react-dom';

const Header = () => {
  const course = 'Half Stack Application Development'

  return (
    <h1>{course}</h1>
  )
}

const Content = () => {
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using Props To Pass Data'
  const exercises2 = 7
  const part3 = 'State of a Component'
  const exercises3 = 14

  return (
      <div>
        <p>
          {part1}: {exercises1}
        </p>
        <p>
          {part2}: {exercises2}
        </p>
        <p>
          {part3}: {exercises3}
        </p>
      </div>
  )
}

const App = () => {
  const course = 'Half Stack Application Development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using Props To Pass Data'
  const exercises2 = 7
  const part3 = 'State of a Component'
  const exercises3 = 14

  return (
    <div>
      <h1>{course}</h1>
      <p>
        {part1}: {exercises1}
      </p>
      <p>
        {part2}: {exercises2}
      </p>
      <p>
        {part3}: {exercises3}
      </p>
      <p>Number of Exercises: {exercises1 + exercises2 + exercises3}</p>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
